generated.css:
@import url('https://fonts.googleapis.com/css?family=Inconsolata');
@import url('https://fonts.googleapis.com/css?family=Noto+Sans');

html {
  box-sizing: border-box;
}

h2 {
  font-size: 2.5rem;
}

body {
  font-family: 'Inconsolata', monospace;
  font-size: 1.5rem;
  line-height: 1.3;
  color: black;
  background-color: snow;
  width: 60rem;
  margin: 0 auto;
}

.container {
  margin: 0 auto;
}

button {
  text-align: center;
  width: 8rem;
  height: 2rem;
  background-color: rgb(241, 241, 241);
  color: rgb(0, 0, 0);
  font-size: 1.3rem;
  border: 2px solid rgb(39, 34, 34); 
  font-family: 'Noto Sans', sans-serif; 
}

input {
  height: 2rem;
  width: 6rem;
  padding: 5px;
  font-family: "Inconsolata", monospace;
  font-size: 1.3rem;
}

.buttons {
  transition-duration: 0.4s; 
}

.buttons:hover { 
  color: rgb(248, 241, 138);
  border-color: rgb(231, 216, 76);
}

.buttons:focus {outline:0;}
